import React from 'react';
import axios from 'axios';
import './styles/realizarCompra.css'

export class Historial extends React.Component {

    state = {
        historial : [],
    };

    async componentDidMount(){
        const historial = await axios.get(`http://localhost:5000/historial`);
        this.setState({historial : historial.data});
    }
    
    render() {
        return (
            <>
            <div className="contaier_realizar_compra">
                <div className="form_wrapper_ordenes">
                        <table className="">
                            <thead>
                                <tr>
                                    <th>Nombre</th>
                                    <th>puntos</th>
                                </tr>
                            </thead>
                            <tbody>
                                {this.state.historial.map((orden,index) => (
                                    <tr key={index}>
                                        <th>{orden.numero_de_orden}</th>
                                        <th>{orden.subtotal}</th>
                                        <th>{orden.iva}</th>
                                        <th>{orden.total}</th>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                </div>
            </div>
        </>
        )
    }
}
